import sys

def main():
    n = int(sys.stdin.readline())
    array = []
    for i in range(n):
        array.append(int(sys.stdin.readline()))

    if len(set(array)) == len(array):
        print('YES')
    else:
        print('NO')

if __name__ == '__main__':
    main()

def main():
    n = int(input())
    a = [int(i) for i in input().split()]
    print('YES' if len(set(a)) == n else 'NO')

if __name__ == '__main__':
    main()

def main():
    n = int(input())
    A = list(map(int, input().split()))

    # リスト内に重複があるかどうか判定する。
    # 重複がある場合はFalse, 無い場合はTrueを返す。
    if len(A) == len(set(A)):
        print('YES')
    else:
        print('NO')

if __name__ == '__main__':
    main()
